    false,nt"url": null,nt"notes": "Digital color infrared (CIR) orthophotography
    of New Jersey in State Plane NAD83 Coordinates, U.S. Survey Feet. The digital orthophotography
    was produced at a scale of 1:2400 (1"=200') with a 1 foot pixel resolution. Digital
    orthophotography combines the image characteristics of a photograph with the geometric
    qualities of a map. Digital orthophotography is a process which converts aerial
    photography from an original photo negative to a digital product that has been positionally
    corrected for camera lens distortion, vertical displacement and variations in aircraft
    altitude and orientation. Aerial photography of the entire State of New Jersey was
    captured during February-April, 2002. The ortho-rectification process achieved a
    +/-4.0 ft. horizontal accuracy at a 95% confidence level, National Standard for
    Spatial Data Accuracy (NSSDA). This dataset consists of 5000' x 5000' files in MrSID
    format with a 15:1 compresssion ratio. The files were produced utilizing MrSID Geospatial
    Edition 1.4 and are approximately 5 MB in size. Digital orthofraphic imagery datasets
    contain georeferenced images of Earth's surface, collected by a sensor in which
    object displacement has been removed for sensor distortions and orientation, and
    terrain relief. Digital orthoimages have the geometric characteristics of a map,
    and image qualities of a photograph.",nt"license_title": null,nt"extras":
